# make sure there is no data: image / jpeg; base64 in the string that returns
def get_as_base64(content_b64):
    content_type_list = [
        "data:image/png;base64,",
        "data:image/jpg;base64,",
        "data:image/jpeg;base64,",
    ]

    images = [
        "data:image/jpeg;base64,iVBORw0KGgoAAAANSUhEUgAAA70AAAHcCAYAAAAa6s",
        "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA70AAAHcCAYAAAAa6s",
    ]
    print("length of images", len(images))
    unified_base64 = []
    for img in images:
        print(img)
        for data in content_type_list:
            if not img.find(data):
                im2 = img.replace(data, "")
                print(im2)

        unified_base64.append(im2)

    for img in unified_base64:
        print("================", img)


